        //     return;
        // }
        // else {.....}
    }

    // only registered Voters are able to cast a single vote to proposal $(toProposal)
    function vote(uint8 toProposal) public {

        // if (stageLimit != 0) {
        //     require(block.timestamp > (startupTime + stageLimit) && block.timestamp <= (startupTime + 2*stageLimit), "The stage of voting is not active.");
        // } 

        Voter storage sender = voters[msg.sender]; 

        require(msg.sender != chairperson, "Chairperson do not have the right to vote.");
        require(sender.weight != 0, "The voter do not have the right to vote.");
        require(sender.voted == false, "The voter has already voted.");
        require(toProposal < proposals.length, "There is no proposal with that index.");   // Πρέπει λογικά να αφαιρεθεί

